    // Inicializar servicio de bluetooth ble
    private final ServiceConnection mServiceConnection = new ServiceConnection() {
        @Override
        public void onServiceConnected(ComponentName componentName, IBinder binder) {
            bluetoothLeService = ((BluetoothLeService.LocalBinder) binder).getService();
            if (!bluetoothLeService.initialize()) {
                Toast.makeText(context, "Unable to initialize Bluetooth", Toast.LENGTH_SHORT).show();
            }
            // Automatically connects to the device upon successful start-up initialization.
            bluetoothLeService.connect(mac);
        }

        @Override
        public void onServiceDisconnected(ComponentName componentName) {
            bluetoothLeService = null;
        }
    };

    // Handles various events fired by the Service.
    // ACTION_GATT_CONNECTED: connected to a GATT server.
    // ACTION_GATT_DISCONNECTED: disconnected from a GATT server.
    // ACTION_GATT_SERVICES_DISCOVERED: discovered GATT services.
    // ACTION_DATA_AVAILABLE: received data from the device.  This can be a result of read
    //                        or notification operations.
    private final BroadcastReceiver mGattUpdateReceiver = new BroadcastReceiver() {
        @Override
        public void onReceive(Context context, Intent intent) {
            final String action = intent.getAction();
            if (BluetoothLeService.ACTION_GATT_CONNECTED.equals(action)) {
                //Log.d("ACTION_GATT_SERV_DSORED","CONECTADO");
                tvconnectionState.setText("Conectado a:\n" + mac);
                tvconnectionState.setTextColor(Color.parseColor("#00a135"));
                esp.putString("mac", mac);
                esp.putString("name", name);
                esp.putString("macUpdate", mac);
                esp.putString("nameUpdate", mac);
                connected();
                esp.apply();
            } else if (BluetoothLeService.ACTION_GATT_DISCONNECTED.equals(action)) {
                //Log.d("ACTION_GATT_SERV_DSORED","DESCONECTADO");
                tvconnectionState.setText("Desconectado");
                tvconnectionState.setTextColor(Color.BLACK);
                tvfwversion.setText("");
                esp.putString("mac", "");
                esp.putString("name", "");
                esp.putString("trefpVersionName", "");
                esp.apply();
                disconnect();
            } else if (BluetoothLeService.ACTION_GATT_SERVICES_DISCOVERED.equals(action)) {
                // Show all the supported services and characteristics on the user interface.
                //Log.d("ACTION_GATT_SERV_Dicovered","TRUE");
            } else if (BluetoothLeService.ACTION_DATA_AVAILABLE.equals(action)) {
                String data = intent.getStringExtra(BluetoothLeService.EXTRA_DATA);
            }
        }
    };

    public BluetoothServices(Context context, FragmentManager fragmentManager, TextView tv, TextView tvv) {
        this.tvfwversion = tvv;
        this.tvconnectionState = tv;
        this.context = context;
        this.fragmentManager = fragmentManager;
        this.sp = this.context.getSharedPreferences("connection_preferences", Context.MODE_PRIVATE);//sp;
        this.esp = this.sp.edit();//sp.edit();
        //this.inflater = inflater;
        data = new String[1000];
        init();
    }

    public void init() {
        // Inicializar adaptador Bluetooth
        bluetoothManager = (BluetoothManager) context.getSystemService(Context.BLUETOOTH_SERVICE);
        bluetoothAdapter = bluetoothManager.getAdapter();
    }

    public boolean isBluetoothEnabled() {
        // ¿Bluetooth disponible y listo para usar?
        //if (isBluetoothAdapterEnabled())

        return !bluetoothAdapter.isEnabled();
        //else
        //  return false;
    }

    public boolean isBluetoothAdapterEnabled() {
        // ¿Bluetooth disponible y listo para usar?
        return bluetoothAdapter != null;
    }

    public boolean BLESupport() {
        //Verificar que el telèfono soporta BLE
        return context.getPackageManager().hasSystemFeature(PackageManager.FEATURE_BLUETOOTH_LE);
    }

    public BluetoothAdapter getBluetoothAdapter() {
        return bluetoothAdapter;
    }

    public BluetoothLeService getBluetoothLeService() {
        return bluetoothLeService;
    }

    public void connect(String name, String mac) {
        //Iniciar servicio de comunicacion

        this.mac = mac;
        this.name = name;
        gattServiceIntent = new Intent(context, BluetoothLeService.class);
        context.bindService(gattServiceIntent, mServiceConnection, BIND_AUTO_CREATE);
        context.registerReceiver(mGattUpdateReceiver, makeGattUpdateIntentFilter());
    }

    public void connected() {
        esp.putBoolean("isconnected", true);
        esp.apply();
    }

    public void disconnect() {
        esp.putBoolean("isconnected", false);
        esp.apply();
        if (bluetoothLeService != null) {
            bluetoothLeService.disconnect();
            bluetoothLeService = null;
            bluetoothManager = null;
            //bluetoothAdapter=null;
            context.unbindService(mServiceConnection);
            context.unregisterReceiver(mGattUpdateReceiver);
        }

    }

    private static IntentFilter makeGattUpdateIntentFilter() {
        final IntentFilter intentFilter = new IntentFilter();
        intentFilter.addAction(BluetoothLeService.ACTION_GATT_CONNECTED);
        intentFilter.addAction(BluetoothLeService.ACTION_GATT_DISCONNECTED);
        intentFilter.addAction(BluetoothLeService.ACTION_GATT_SERVICES_DISCOVERED);
        intentFilter.addAction(BluetoothLeService.ACTION_DATA_AVAILABLE);
        return intentFilter;
    }

