    /**
     * FALTA HACER LA COMPROBACION DE LA INTEGRIDAD DEL ARCHIVO ORIGINAL, DEBE SER ENTERO, POR EJEMPLO 15KB DE ARCHIVO * 1024 / 128=120 PAQUETES
     */
    public void dividirFirmware102(String command) {
        //divide el firmware en partes de 128 (16 letras) + 4 bytes de checksum
        //getNewFWVersion(command);

        StringBuilder stringBuilder = new StringBuilder();
        stringBuilder.append(GetRealDataFromHexaImbera.getDecimal(command.substring(256, 258)));
        stringBuilder.append(".");
        Log.d("VERSION", ":" + command.substring(2));
        int version = GetRealDataFromHexaImbera.getDecimal(command.substring(258, 260));
        if (version < 10) {
            stringBuilder.append("0" + String.valueOf(version));
        } else {
            stringBuilder.append(GetRealDataFromHexaImbera.getDecimal(command.substring(258, 260)));
        }

        newFirmwareVersion = stringBuilder.toString();
        newFimwareModelo = String.valueOf(GetRealDataFromHexaImbera.getDecimalFloat(command.substring(260, 262)));

        int i = 0;
        int j = 256;
        firmCommandCut.clear();
        FinalFirmwareCommands.clear();
        checksumTotal = 0;
        do {//dividir en partes
            firmCommandCut.add(command.substring(i, j));
            i = j;
            j += 256;
            if (j == command.length()) {
                firmCommandCut.add(command.substring(i));
            }
        } while (j < command.length());

        int checksum;

        for (int p = 0; p < firmCommandCut.size(); p++) {
            String s = firmCommandCut.get(p);
            checksum = 0;
            for (int h = 0; h < s.length(); h += 2) {
                checksum = checksum + getDecimal(s.substring(h, h + 2));
            }
            checksumTotal = checksumTotal + checksum;
            String c = Integer.toHexString(checksum);
            String finalchecksum = "";
            if (c.length() == 1)
                finalchecksum = "0000000" + c;
            else if (c.length() == 2)
                finalchecksum = "000000" + c;
            else if (c.length() == 3)
                finalchecksum = "00000" + c;
            else if (c.length() == 4)
                finalchecksum = "0000" + c;
            else if (c.length() == 5)
                finalchecksum = "000" + c;
            else if (c.length() == 6)
                finalchecksum = "00" + c;
            else if (c.length() == 7)
                finalchecksum = "0" + c;
            else
                finalchecksum = c;
            FinalFirmwareCommands.add(s + finalchecksum);
        }
    }

